/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Axios from 'axios';

// Logout feature
import { logout } from '../../../components/logout';

// Import API functions
import { handleSubmitNewRso } from './API/handleSubmitNewRso';

// Import HTML component

function MainRso()
{
    // Used to navigate around the web app
    const navigate = useNavigate();

    // useState used to hold the RSO name to be sent to the backend
    const [rsoName, setRsoName] = useState('');

    const uniId = sessionStorage.getItem('universityId')
    const creatorId = sessionStorage.getItem('id')

    // useEffect to show all the 
    
    return (
        <>
        <div className='navButstons'>
            <button onClick={ logout }>Logout</button>
            <button onClick={() => navigate('/studentHome')}>Home</button>
        </div>
            <div className='inputForm'>
                RSO PAGE
                <form className='createRsoForm' id='createRsoForm' onSubmit={(e) =>
                {
                    e.preventDefault();
                    handleSubmitNewRso(rsoName, uniId, creatorId);
                }}>
                    <h2>Submit New RSO</h2>
                    <label htmlFor='name'>RSO Name:</label>
                    <input type='text' id='name' onChange={(e) =>
                    {
                        setRsoName(e.target.value);
                    }}></input>
                    <br></br>
                    <button type='submit'>Submit </button>
                </form>
            </div>
            <div className='table'>
                <h1>Active Rso's</h1>
                <table>
                    <thead>
                            <tr>
                                <th>RSO Name</th>
                                <th>Admin</th>
                                <th>Total Members</th>
                                <th>Status</th>
                                <th>Actions</th>
                            </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Row 1</td>
                            <td>Row 2</td>
                            <td>Row 3</td>
                            <td>Row 4</td>
                            <td>
                                <button>Join/Leave</button>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>

        </>
    )
}

export default MainRso;
